{
{ <ID here> -- First shape { -- List of different scales { -- Scale 1 <vertex and port stuff here> } { -- Scale 2 <vertex and port stuff here> } { -- Scale 3 <vertex and port stuff here> } }
}
{ <Different ID here> -- Second block { -- List of only one scale { -- Scale 1 <vertex and port stuff here> } }
